import React, { Component } from 'react';

export default class InstallButton extends Component {
  constructor(){
    super();
    this.state = {
    textValue: 'Temporary text'
    }
    this.onPressButton= this.onPressButton.bind(this);
}

onPressButton() {
    this.setState({
        textValue: 'Text has been changed'
    })
}

  render() {
    return (
        <button title="Change Text" onPress = {this.onPress}><h5>{this.state.textValue}</h5></button>
    )
  }
}
